import { useNavigate } from "react-router-dom";

export const Modal = () => {
  const navigate = useNavigate();
  return (
    <div className="modalDiv">
      <div className="modal">
        
        
        <button onClick={() => navigate(-1)}>Close</button>
      </div>
    </div>
  );
};
export default Modal;
